  \"quarterly-narrative-report-august-october-1940-valentine-lakes-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments from August through October of 1940. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
  and raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and collections and receipts. Resource management
  is outlined; topics include haying. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  Refuge participation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
